function Layout(props) {
  return (
    <div className='warp'>
      <div className='content-wrap'>

    <header className='header'>
      <h1>My Todo List</h1>
      <span>React</span>
    </header>
    {props.children}
    </div>
      </div>
  )
}

export default Layout
